Local NumberVar x;
x := 10;

//Note The keyword for declaring the Number variable 
//has a Var at the end. This is true for all the 
//variable types in Crystal syntax.

//A variable can only hold values of one type. 
//For example, if a variable holds a Number value, 
//you cannot later use it to hold a String.

Local StringVar y;
y := "hello";
//OK- the Length function expects a String argument.
Length (y);
//Error- y can only hold String values.
y := #Jan 5, 1993#;
//Error- y can only hold String values.
y := ["a", "bb", "ccc"];
//Error- the Sin function expects a Number argument.
Sin (y);

//You can combine declaring a variable and assigning it 
//a value in a single expression. For example:

Local NumberVar x := 10 + 20;
Local StringVar y := "Hello" + " " + "World";
Local DateVar z := CDate (#Sept 20, 1999#);
Local NumberVar Range gradeA := 90 To 100;

//This is a good practice because it is more efficient 
//and helps prevent the common mistake of having 
//incorrectly initialized variables.

//Here are some more examples of declaring and 
//initializing range variables:

Local NumberVar Range gradeA;
Local DateVar Range quarter;
gradeA := 90 To 100;
quarter := CDate (1999, 10, 1) To CDate (1999, 12, 31);
